import React from "react";
import PropTypes from "prop-types";
import {Router,Link } from "react-router-dom";
import styles from "./styles.module.scss";
import gold_1 from "../../images/gold_1.png"
const Summoner = (props, context) => (
  <div className={styles.summoner}>
      <div className={styles.box}>
          <div className={styles.left} >
            <img
                src={gold_1}
                alt={"Logo"}
                className={styles.logo}/>
          </div>
          <div className={styles.right} >
            <div className={styles.name}>로즈골드스타킹</div>
            <div className={styles.tier}>GOLD 1 70LP</div>
            <div className={styles.buttons}>
            <button className={styles.mmr} style="position: relative;">
            전적 갱신			
            </button>
            </div>
          </div>
      </div>
  </div>
);

Summoner.propTypes = {
  loading : PropTypes.bool.isRequired,
};

export default Summoner;
